import React from 'react';
import { createBrowserRouter, RouterProvider } from 'react-router-dom';

/**root routes */
const router = createBrowserRouter([
    {
        path : '/',
        element : <div>Root Route</div>
    },
    {
        path : '/register',
        element : <div>Register Route</div>
    },
    {
        path : '/home',
        element : <div>Home Route</div>
    },
    {
        path : '/register_component',
        element : <div>Register_Component</div>
    },
    {
        path : '/remove_component',
        element : <div>Remove_Component</div>
    },
    {
        path : '/serialnumber_generation',
        element : <div>Serial Number Generation</div>
    },
])
export default function App() {
    return (
        <main>
            <RouterProvider router={router}></RouterProvider>
        </main>
    )
}
